import React, { useEffect, useState } from "react";

export default function Users() {
  const [users, setUsers] = useState([]);
  const [form, setForm] = useState({ nom: "", prenom: "", type: "", email: "" });

  const API_URL = "http://localhost:3000/api/utilisateurs";

  const charger = () => {
    fetch(API_URL)
      .then(res => res.json())
      .then(data => setUsers(data));
  };

  useEffect(() => {
    charger();
  }, []);

  const supprimer = (id) => {
    fetch(`${API_URL}/${id}`, { method: "DELETE" })
      .then(() => charger());
  };

  const ajouter = (e) => {
    e.preventDefault();
    fetch(API_URL, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(form)
    }).then(() => {
      setForm({ nom: "", prenom: "", type: "", email: "" });
      charger();
    });
  };

  return (
    <div className="container mt-4">
      <div className="card shadow-sm">
        <div className="card-body">
          <h2 className="card-title">
            <i className="bi bi-people"></i> Gestion des utilisateurs
          </h2>
          <table className="table table-hover">
            <thead className="table-light">
              <tr>
                <th>Nom</th>
                <th>Prénom</th>
                <th>Type</th>
                <th>Email</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {users.map(u => (
                <tr key={u.id}>
                  <td>{u.nom}</td>
                  <td>{u.prenom}</td>
                  <td>{u.type}</td>
                  <td>{u.email}</td>
                  <td>
                    <button
                      className="btn btn-outline-danger btn-sm"
                      onClick={() => supprimer(u.id)}
                    >
                      <i className="bi bi-trash"></i>
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          <h4 className="mt-4">Ajouter un utilisateur</h4>
          <form className="row g-2 align-items-center" onSubmit={ajouter}>
            <div className="col">
              <input
                className="form-control"
                placeholder="Nom"
                value={form.nom}
                onChange={e => setForm({ ...form, nom: e.target.value })}
                required
              />
            </div>
            <div className="col">
              <input
                className="form-control"
                placeholder="Prénom"
                value={form.prenom}
                onChange={e => setForm({ ...form, prenom: e.target.value })}
                required
              />
            </div>
            <div className="col">
              <input
                className="form-control"
                placeholder="Type (eleve/prof/invite)"
                value={form.type}
                onChange={e => setForm({ ...form, type: e.target.value })}
                required
              />
            </div>
            <div className="col">
              <input
                className="form-control"
                placeholder="Email"
                value={form.email}
                onChange={e => setForm({ ...form, email: e.target.value })}
              />
            </div>
            <div className="col">
              <button className="btn btn-primary">
                <i className="bi bi-plus-circle"></i> Ajouter
              </button>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
}
